A self-aligning coupler for superposed surfaces is disclosed, comprising: a circular and semi-spherical base (10) formed on a first surface (1); a fastening element (20) perpendicularly passing through the circular and semi-spherical base (10) and associated to a second surface (2); and at least a semi-spherical insert (30) disposed on the circular and semi-spherical base (10) and concentric to the fastening element (20). Said semi-spherical insert (30) being cooperative with the circular and semi-spherical base (10) and the fastening element (20) for the self-alignment and fastening of the first and second surfaces (1, 2) superposedly. A method of self-aligning coupler for superposed surfaces is also disclosed, comprising the steps of: 
a) formation of a circular and semi-spherical base (10) on a first surface (1); 
b) disposition of a fastening element (20) perpendicularly passing through the circular and semi-spherical base (10); 
c) positioning of at least a semi-spherical insert (30) on the circular and semi-spherical base (10) and concentric to the fastening element (20); 
d) application of a tightening force to the fastening element (20); and 
e) self-alignment and fastening of the first surface (1) superposed the second surface (2) by way of compensation and adjustment between the circular and semi-spherical base (10) and at least a semi-spherical insert (30).

